  `fixed` varchar(20) DEFAULT NULL COMMENT '冻结位置',
  `toggled` varchar(20) DEFAULT NULL COMMENT '是否展示',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `page_result_field_page_id_fk` (`page_id`) USING BTREE,
  CONSTRAINT `page_result_field_page_id_fk` FOREIGN KEY (`page_id`) REFERENCES `page` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3062 DEFAULT CHARSET=utf8 COMMENT='页面查询结果';
CREATE TABLE `permission` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(64) DEFAULT NULL COMMENT '权限编码',
  `name` varchar(64) DEFAULT NULL COMMENT '权限名称',
  `permission_type` varchar(20) DEFAULT NULL COMMENT '权限类型',
  `permission_value` varchar(1024) DEFAULT NULL COMMENT '配置值',
  `component_type` varchar(64) DEFAULT NULL COMMENT '组件类型',
  `muiti` varchar(20) DEFAULT NULL COMMENT '是否多选',
  `remark` varchar(1024) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `permission_code` (`code`) USING BTREE COMMENT '权限编码索引'
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='权限';
CREATE TABLE `position` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(64) NOT NULL COMMENT '岗位编号',
  `name` varchar(64) NOT NULL COMMENT '岗位名称',
  `position_type` varchar(20) NOT NULL COMMENT '岗位类型',
  `enterprise_id` bigint(20) DEFAULT NULL COMMENT '企业id',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `position_code` (`code`) USING BTREE COMMENT '岗位编号索引',
  KEY `position_enterprise_id` (`enterprise_id`) USING BTREE COMMENT '企业id索引',
  KEY `position_type` (`position_type`) USING BTREE COMMENT '岗位类型索引',
  CONSTRAINT `position_enterprise_id_fk` FOREIGN KEY (`enterprise_id`) REFERENCES `enterprise` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='岗位';
CREATE TABLE `position_menu` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `position_id` bigint(20) DEFAULT NULL COMMENT '岗位id',
  `enterprise_id` bigint(20) DEFAULT NULL COMMENT '企业id',
  `menu_id` bigint(20) DEFAULT NULL COMMENT '菜单id',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `position_menu_position_id` (`position_id`) USING BTREE COMMENT '岗位菜单_岗位id索引',
  KEY `position_menu_enterprise_id` (`enterprise_id`) USING BTREE COMMENT '岗位菜单_企业id索引',
  KEY `position_menu_menu_id` (`menu_id`) USING BTREE COMMENT '岗位菜单_菜单id索引',
  CONSTRAINT `position_menu_enterprise_id_fk` FOREIGN KEY (`enterprise_id`) REFERENCES `enterprise` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `position_menu_menu_id_fk` FOREIGN KEY (`menu_id`) REFERENCES `sys_menu` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `position_menu_position_id_fk` FOREIGN KEY (`position_id`) REFERENCES `position` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=167 DEFAULT CHARSET=utf8 COMMENT='岗位菜单';
CREATE TABLE `position_permission` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `position_id` bigint(20) DEFAULT NULL COMMENT '岗位id',
  `enterprise_id` bigint(20) DEFAULT NULL COMMENT '企业id',
  `permission_id` bigint(20) DEFAULT NULL COMMENT '权限id',
  `config_value` varchar(64) DEFAULT NULL COMMENT '配置值',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `position_permission_position_id_fk` (`position_id`) USING BTREE,
  KEY `position_permission_permission_id_fk` (`permission_id`) USING BTREE,
  KEY `position_permission_enterprise_id_fk` (`enterprise_id`) USING BTREE,
  CONSTRAINT `position_permission_enterprise_id_fk` FOREIGN KEY (`enterprise_id`) REFERENCES `enterprise` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `position_permission_permission_id_fk` FOREIGN KEY (`permission_id`) REFERENCES `permission` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `position_permission_position_id_fk` FOREIGN KEY (`position_id`) REFERENCES `position` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COMMENT='岗位数据权限';
CREATE TABLE `serial_number` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(64) DEFAULT NULL COMMENT '编号',
  `name` varchar(64) DEFAULT NULL COMMENT '名称',
  `prefix` varchar(64) DEFAULT NULL COMMENT '前缀',
  `date_format` varchar(20) DEFAULT NULL COMMENT '日期格式',
  `cur_date` varchar(64) DEFAULT NULL COMMENT '当前日期',
  `cur_serial` int(11) DEFAULT NULL COMMENT '当前顺序号',
  `serial_lenth` int(11) DEFAULT NULL COMMENT '顺序号长度',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `serial_number_code` (`code`) USING BTREE COMMENT '序号编码索引'
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='序号';
CREATE TABLE `sql_api` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(64) DEFAULT NULL COMMENT '名称',
  `code` varchar(64) DEFAULT NULL COMMENT '编号',
  `sql_api_prefix` varchar(64) DEFAULT NULL COMMENT '前缀',
  `content` longtext COMMENT '内容',
  `sql_api_type` varchar(20) DEFAULT NULL COMMENT '类型',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='sql接口';
CREATE TABLE `sql_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(64) NOT NULL COMMENT '编号',
  `name` varchar(256) NOT NULL COMMENT '名称',
  `sql_info` longtext NOT NULL COMMENT 'sql语句',
  `sql_type` varchar(20) NOT NULL COMMENT 'sql类型',
  `ref_sql_codes` longtext COMMENT '关联sql',
  PRIMARY KEY (`id`),
  KEY `sql_code_idx` (`code`) COMMENT 'sql编号索引'
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='sql语句';
CREATE TABLE `sql_param` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sql_info_id` bigint(20) NOT NULL COMMENT 'sql主键',
  `seq` int(11) NOT NULL COMMENT '序号',
  `name` varchar(64) NOT NULL COMMENT '参数名称',
  `label` varchar(64) NOT NULL COMMENT '参数标签',
  `must` varchar(20) NOT NULL COMMENT '是否必填',
  `param_type` varchar(20) NOT NULL COMMENT '参数类型',
  `format` varchar(1024) DEFAULT NULL COMMENT '格式化',
  `default_value` varchar(256) DEFAULT NULL COMMENT '默认值',
  PRIMARY KEY (`id`),
  KEY `sql_param_sql_info_id` (`sql_info_id`),
  CONSTRAINT `sql_param_sql_info_id` FOREIGN KEY (`sql_info_id`) REFERENCES `sql_info` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='sql参数';
CREATE TABLE `sql_result` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sql_info_id` bigint(20) NOT NULL COMMENT 'sql主键',
  `field` varchar(64) NOT NULL COMMENT '字段',
  `label` varchar(64) NOT NULL COMMENT '名称',
  `type` varchar(20) NOT NULL COMMENT '类型',
  `format` varchar(64) DEFAULT NULL COMMENT '格式化',
  `seq` int(11) NOT NULL COMMENT '序号',
  PRIMARY KEY (`id`),
  KEY `sql_result_sql_info_id_fk` (`sql_info_id`),
  CONSTRAINT `sql_result_sql_info_id_fk` FOREIGN KEY (`sql_info_id`) REFERENCES `sql_info` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='sql结果';
CREATE TABLE `sys_file` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `file_name` varchar(256) DEFAULT NULL COMMENT '文件名',
  `suffix` varchar(20) DEFAULT NULL COMMENT '文件后缀',
  `size` bigint(20) DEFAULT NULL COMMENT '文件大小',
  `path` varchar(1024) DEFAULT NULL COMMENT '路径',
  `upload_time` datetime DEFAULT NULL COMMENT '上传时间',
  `content_type` varchar(256) DEFAULT NULL COMMENT '文件类型',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COMMENT='系统文件';
CREATE TABLE `sys_menu` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父菜单',
  `menu_code` varchar(64) DEFAULT NULL COMMENT '菜单编号',
  `menu_name` varchar(256) DEFAULT NULL COMMENT '菜单名称',
  `menu_type` varchar(20) DEFAULT NULL COMMENT '菜单类型',
  `url` varchar(1024) DEFAULT NULL COMMENT '菜单地址',
  `seq` int(11) DEFAULT NULL COMMENT '序号',
  `icon` varchar(64) DEFAULT NULL COMMENT '图标',
  `whether_button` varchar(20) DEFAULT NULL COMMENT '是否按钮',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `sys_menu_parent_id_fk` (`parent_id`) USING BTREE,
  CONSTRAINT `sys_menu_parent_id_fk` FOREIGN KEY (`parent_id`) REFERENCES `sys_menu` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=195 DEFAULT CHARSET=utf8 COMMENT='系统菜单';
CREATE TABLE `t_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_num` varchar(20) NOT NULL COMMENT '订单编号',
  `order_name` varchar(20) DEFAULT NULL COMMENT '订单名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单测试33';
CREATE TABLE `template` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(256) DEFAULT NULL COMMENT '编号',
  `name` varchar(256) DEFAULT NULL COMMENT '名称',
  `seq` int(11) DEFAULT NULL COMMENT '序号',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父id',
  `content` longtext COMMENT '内容',
  `params` longtext COMMENT '测试参数',
  `template_type` varchar(64) DEFAULT NULL COMMENT '模板类型',
  PRIMARY KEY (`id`),
  KEY `fk_template_parent_id` (`parent_id`),
  KEY `idx_template_code` (`code`) COMMENT 'null',
  CONSTRAINT `fk_template_parent_id` FOREIGN KEY (`parent_id`) REFERENCES `template` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='模板';
CREATE TABLE `test_data_import` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `enterprise_id` bigint(20) NOT NULL COMMENT '企业id',
  `birthday` datetime NOT NULL COMMENT '生日',
  `age` int(11) NOT NULL COMMENT '年龄',
  `gender` varchar(20) NOT NULL COMMENT '性别',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='测试数据导入';
CREATE TABLE `test_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `order_code` varchar(64) NOT NULL COMMENT '订单号',
  `customer_manager_id` bigint(20) NOT NULL COMMENT '客户经理id',
  `designer_id` bigint(20) DEFAULT NULL COMMENT '设计师id',
  `test_order_status` varchar(20) NOT NULL COMMENT '订单状态',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `amount` float(19,2) DEFAULT NULL COMMENT '订单金额',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='测试订单';
CREATE TABLE `timer_task` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(64) DEFAULT NULL COMMENT '任务名称',
  `api` varchar(1024) DEFAULT NULL COMMENT '接口',
  `scheduling_pattern` varchar(1024) DEFAULT NULL COMMENT '执行频率',
  `data_status` varchar(1024) DEFAULT NULL COMMENT '状态',
  `params` longtext COMMENT '参数',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='定时任务';
CREATE TABLE `timer_task_record` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `timer_task_id` bigint(20) NOT NULL COMMENT '定时任务id',
  `timer_task_record_status` varchar(20) NOT NULL COMMENT '执行状态',
  `start_time` datetime NOT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `params` longtext COMMENT '参数',
  `msg` varchar(1024) DEFAULT NULL COMMENT '提示信息',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='定时任务记录';
CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_code` varchar(64) DEFAULT NULL COMMENT '用户编号',
  `name` varchar(64) DEFAULT NULL COMMENT '姓名',
  `mobile` varchar(64) DEFAULT NULL COMMENT '手机号',
  `password` varchar(64) DEFAULT NULL COMMENT '密码',
  `salt` varchar(64) DEFAULT NULL COMMENT '密码盐',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `avatar` varchar(1024) DEFAULT NULL COMMENT '头像',
  `user_type` varchar(20) DEFAULT NULL COMMENT '用户类型',
  `user_status` varchar(20) DEFAULT NULL COMMENT '用户状态',
  `other_files` varchar(1024) DEFAULT NULL COMMENT '附件列表',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_user_code` (`user_code`) USING BTREE COMMENT '用户编号'
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='用户';
CREATE TABLE `user_permission` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `enterprise_user_id` bigint(20) DEFAULT NULL COMMENT '部门id',
  `permission_id` bigint(20) DEFAULT NULL COMMENT '权限id',
  `config_value` varchar(256) DEFAULT NULL COMMENT '配置值',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_permission_enterprise_user_id_fk` (`enterprise_user_id`) USING BTREE,
  KEY `user_permission_permission_id_fk` (`permission_id`) USING BTREE,
  CONSTRAINT `user_permission_enterprise_user_id_fk` FOREIGN KEY (`enterprise_user_id`) REFERENCES `enterprise_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_permission_permission_id_fk` FOREIGN KEY (`permission_id`) REFERENCES `permission` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='用户数据权限';
