INSERT INTO `db_amis`.`chart` (`id`,`name`,`config`,`querySql`,`code`) VALUES (2, '单列柱状图', 'config={\r\n  xAxis: {\r\n    data: [\'Mon\', \'Tue\', \'Wed\', \'Thu\', \'Fri\', \'Sat\', \'Sun\']\r\n  },\r\n  yAxis: {},\r\n  series: [\r\n    {\r\n      type: \'bar\',\r\n      data: [23, 24, 18, 25, 27, 28, 25]\r\n    }\r\n  ]\r\n};\r\nAMIS_JSON = {\r\n  \"type\": \"page\",\r\n  \"body\": {\r\n    \"type\": \"chart\",\r\n    \"config\": config\r\n  }\r\n}', NULL, 'test1'),(3, '多列柱状图', 'config={\r\n  legend: {},\r\n  tooltip: {},\r\n  dataset: {\r\n    // 用 dimensions 指定了维度的顺序。直角坐标系中，如果 X 轴 type 为 category，\r\n    // 默认把第一个维度映射到 X 轴上，后面维度映射到 Y 轴上。\r\n    // 如果不指定 dimensions，也可以通过指定 series.encode\r\n    // 完成映射，参见后文。\r\n    dimensions: [\'product\', \'2015\', \'2016\', \'2017\'],\r\n    source: [\r\n      { product: \'Matcha Latte\', \'2015\': 43.3, \'2016\': 85.8, \'2017\': 93.7 },\r\n      { product: \'Milk Tea\', \'2015\': 83.1, \'2016\': 73.4, \'2017\': 55.1 },\r\n      { product: \'Cheese Cocoa\', \'2015\': 86.4, \'2016\': 65.2, \'2017\': 82.5 },\r\n      { product: \'Walnut Brownie\', \'2015\': 72.4, \'2016\': 53.9, \'2017\': 39.1 }\r\n    ]\r\n  },\r\n  xAxis: { type: \'category\' },\r\n  yAxis: {},\r\n  series: [{ type: \'bar\' }, { type: \'bar\' }, { type: \'bar\' }]\r\n};\r\nAMIS_JSON = {\r\n  \"type\": \"page\",\r\n  \"body\": {\r\n    \"type\": \"chart\",\r\n    \"config\": config\r\n  }\r\n}', NULL, 'test2'),(4, '单列柱状图-数据', 'config={\r\n  legend: {},\r\n  tooltip: {},\r\n  dataset: {\r\n    // 用 dimensions 指定了维度的顺序。直角坐标系中，如果 X 轴 type 为 category，\r\n    // 默认把第一个维度映射到 X 轴上，后面维度映射到 Y 轴上。\r\n    // 如果不指定 dimensions，也可以通过指定 series.encode\r\n    // 完成映射，参见后文。\r\n    dimensions: [\'year\',\'salary\'],\r\n    source: ${data0}\r\n  },\r\n  xAxis: { type: \'category\' },\r\n  yAxis: {},\r\n  series: [{ type: \'bar\' }]\r\n};\r\nAMIS_JSON = {\r\n  \"type\": \"page\",\r\n  \"body\": {\r\n    \"type\": \"chart\",\r\n    \"config\": config\r\n  }\r\n}', 'SELECT year,salary FROM `chart_test_data1` d where d.`name` = \'张三\';', 'test3'),(5, '多列柱状图-数据', 'config={\r\n  legend: {},\r\n  tooltip: {},\r\n  dataset: {\r\n    // 用 dimensions 指定了维度的顺序。直角坐标系中，如果 X 轴 type 为 category，\r\n    // 默认把第一个维度映射到 X 轴上，后面维度映射到 Y 轴上。\r\n    // 如果不指定 dimensions，也可以通过指定 series.encode\r\n    // 完成映射，参见后文。\r\n    dimensions: [\'name\',\'2014\',\'2015\',\'2016\'],\r\n    source: ${data0}\r\n  },\r\n  xAxis: { type: \'category\' },\r\n  yAxis: {},\r\n  series: [{ type: \'bar\' },{ type: \'bar\' },{ type: \'bar\' }]\r\n};\r\nAMIS_JSON = {\r\n  \"type\": \"page\",\r\n  \"body\": {\r\n    \"type\": \"chart\",\r\n    \"config\": config\r\n  }\r\n}', 'SELECT \r\n	name,\r\n	max(\r\n		case \r\n			when year = 2014\r\n			  then salary\r\n			else 0\r\n		end\r\n	) \'2014\',\r\n	max(\r\n		case \r\n			when year = 2015\r\n			  then salary\r\n			else 0\r\n		end\r\n	) \'2015\',\r\n	max(\r\n		case \r\n			when year = 2016\r\n			  then salary\r\n			else 0\r\n		end\r\n	) \'2016\'\r\n	\r\n	\r\nFROM\r\n	chart_test_data1 d \r\n\r\ngroup by name ', 'test4');
UNLOCK TABLES;
COMMIT;
