UNLOCK TABLES;
COMMIT;
BEGIN;
LOCK TABLES `db_amis`.`page` WRITE;
DELETE FROM `db_amis`.`page`;
INSERT INTO `db_amis`.`page` (`id`,`code`,`query_sql`,`page_type`,`order_by`,`js`,`name`,`label_field`,`value_field`,`width`,`before_api`,`open_page`,`introduce`,`open_row_num`,`per_page`,`extra_json`,`after_query_api`) VALUES (2, 'menu', 'select * from sys_menu', 'tree', 'order by seq asc', '', '菜单管理', 'menuName', 'id', NULL, '', 'YES', '', 'NO', NULL, '', NULL),(3, 'dic', 'select * from dic', 'list', NULL, '', '字典', NULL, NULL, 6, NULL, NULL, NULL, NULL, 10, NULL, NULL),(4, 'dic_item', 'select * from dic_item', 'list', 'order by seq asc', '', '字典明细', NULL, NULL, NULL, NULL, 'NO', NULL, NULL, NULL, NULL, NULL),(7, 'form', 'select * from form ', 'list', NULL, '', '表单管理', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(9, 'dic_item_read_only', 'select * from dic_item', 'list', NULL, '', '字典明细-查看', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(10, 'config', 'select * from config', 'list', NULL, '', '系统配置', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(12, 'user', '-- 查询用户\nselect\n	u.id, -- 主键\n	u.user_code, -- 用户编号\n	u.name, -- 姓名\n	u.mobile, -- 手机号\n	u.create_time, -- 创建时间\n	u.update_time, -- 更新时间\n	u.avatar, -- 头像\n	u.user_type, -- 用户类型\n	u.user_status, -- 用户状态\n	u.other_files -- 附件列表\nfrom user u', 'list', ' order by id desc ', '', '用户列表', 'name', 'id', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(13, 'serialNumber', '-- 查询序号\nselect\n	id, -- 主键\n	sn.code, -- 编号\n	sn.name, -- 名称\n	sn.prefix, -- 前缀\n	sn.date_format, -- 日期格式\n	sn.cur_date, -- 当前日期\n	sn.cur_serial, -- 当前顺序号\n	sn.serial_lenth -- 顺序号长度\nfrom serial_number sn', 'list', ' order by id desc ', '', '序号列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(14, 'enterprise', '-- 查询企业\nselect\n	id, -- 主键\n	e.code, -- 编号\n	e.name, -- 名称\n	e.logo, -- logo\n	e.address -- 地址\nfrom enterprise e', 'list', ' order by id desc ', '', '企业列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(15, 'enterpriseManager', '-- 查询企业负责人\nselect\n	em.id, -- 主键\n	em.enterprise_id, -- 企业id\n	em.user_id, -- 人员id\n	u.name -- 人员姓名\nfrom enterprise_manager em\nleft join user u on u.id = em.user_id', 'list', ' order by id desc ', '', '企业负责人列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(16, 'position', '-- 查询岗位\nselect\n	id, -- 主键\n	p.code, -- 岗位编号\n	p.name, -- 岗位名称\n	p.position_type, -- 岗位类型\n	p.enterprise_id -- 企业id\nfrom position p\nwhere (\n	-- 自定义岗位或者固定岗位\n	(p.enterprise_id = ${enterpriseId} and p.position_type = 2) \n	or p.position_type = 1\n)', 'list', ' order by id desc ', '', '岗位列表', 'name', 'id', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(17, 'positionFixed', '-- 查询岗位\nselect\n	id, -- 主键\n	p.code, -- 岗位编号\n	p.name, -- 岗位名称\n	p.position_type, -- 岗位类型\n	p.enterprise_id -- 企业id\nfrom position p\nwhere (\n	-- 固定岗位\n	p.position_type = 1\n)', 'list', 'order by id desc', '', '固定岗位', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(18, 'enterpriseMenu', 'select * from sys_menu\r\nwhere id in (\r\n    $service.findAllParent(\'select menu_id from enterprise_menu where enterprise_id = $enterpriseId\',\'sys_menu\')\r\n)', 'tree', 'order by seq asc', '', '企业菜单', 'menuName', 'id', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(19, 'enterpriseUser', '-- 查询用户\nselect\n	eu.id, -- 主键\n	eu.user_id ,-- 用户id\n	u.user_code, -- 用户编号\n	u.name, -- 姓名\n	dept.name dept_name, -- 部门名称\n	dept.id dept_id, -- 部门id\n	u.mobile, -- 手机号\n	u.create_time, -- 创建时间\n	u.update_time, -- 更新时间\n	u.user_type, -- 用户类型\n	u.user_status-- 用户状态\nfrom enterprise_user eu\nleft join user u on eu.user_id = u.id\nleft join dept on dept.id = eu.dept_id\nwhere eu.enterprise_id = $enterpriseId', 'list', ' order by id desc ', '', '企业用户', 'name', 'id', 6, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(20, 'dept', '-- 查询部门\nselect\n	id, -- 主键\n	d.code, -- 部门编号\n	d.name, -- 部门名称\n	d.parent_id, -- 父部门id\n	d.dept_type -- 部门类型\nfrom dept d\nwhere d.enterprise_id = $enterpriseId', 'tree', 'order by code asc', '', '部门列表', 'name', 'id', NULL, NULL, 'NO', NULL, NULL, NULL, NULL, NULL),(21, 'enterpriseUserPosition', '-- 查询企业用户岗位\nselect\n	eup.id, -- 主键\n	eup.enterprise_user_id, -- 企业用户id\n	p.name, -- 岗位名称\n	p.code -- 岗位编号\nfrom enterprise_user_position eup\nleft join position p on p.id = eup.position_id', 'list', ' order by id desc ', '', '用户岗位', NULL, NULL, NULL, NULL, 'NO', NULL, NULL, NULL, NULL, NULL),(22, 'otherEnterpriseUser', '-- 查询用户\nselect\n	u.id, -- 主键\n	u.user_code, -- 用户编号\n	u.name, -- 姓名\n	u.mobile, -- 手机号\n	u.create_time, -- 创建时间\n	u.update_time, -- 更新时间\n	u.avatar, -- 头像\n	u.user_status, -- 用户状态\n	u.other_files -- 附件列表\nfrom user u\nwhere u.user_type = \'common\' \nand not exists (\n	select id from enterprise_user eu where eu.user_id = u.id and eu.enterprise_id = $enterpriseId\n)', 'list', ' order by id desc ', '', '其他企业用户', 'name', 'id', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(23, 'currentUserMenu', 'select m.* from sys_menu m\r\nleft join user u on u.id = $userId\r\nleft join enterprise_manager emu on emu.user_id = $userId and emu.enterprise_id = $enterpriseId \r\nwhere \r\n-- 后台菜单\r\nm.menu_type = 1 \r\n-- 不是按钮\r\nand m.whether_button = \'NO\'\r\nand\r\n(\r\n	(\r\n		(\r\n			u.user_type = \'admin\'\r\n			or emu.id is not null\r\n		)\r\n		and m.id in (\r\n            $service.findAllParent(\'\r\n			    select menu_id from enterprise_menu em where em.enterprise_id = $enterpriseId\r\n            \'\r\n            ,\'sys_menu\'\r\n            )\r\n		)\r\n	) or \r\n	(\r\n		u.user_type = \'common\'\r\n		and emu.id is null \r\n		and m.id in(\r\n            $service.findAllParent(\'\r\n			    select menu_id from position_menu \r\n                where enterprise_id = $enterpriseId  \r\n                and position_id in(\r\n                    select position_id from enterprise_user_position \r\n                    where enterprise_user_id in (\r\n                        select id from enterprise_user where enterprise_id = $enterpriseId  and user_id = $userId \r\n                    )\r\n                )\r\n            \'\r\n            ,\'sys_menu\'\r\n            )\r\n		)\r\n	)\r\n)\r\n', 'tree', 'order by seq asc', '', '当前用户菜单', 'menuName', 'id', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(24, 'currentUserButton', 'select distinct m.menu_code from sys_menu m\r\nleft join user u on u.id = $userId\r\nleft join enterprise_manager emu on emu.user_id = $userId and emu.enterprise_id = $enterpriseId \r\nwhere \r\n-- 后台菜单\r\nm.menu_type = 1 \r\n-- 不是按钮\r\nand m.whether_button = \'YES\'\r\nand\r\n(\r\n	(\r\n		(\r\n			u.user_type = \'admin\'\r\n			or emu.id is not null\r\n		)\r\n		and m.id in (\r\n            $service.findAllParent(\'\r\n			    select menu_id from enterprise_menu em where em.enterprise_id = $enterpriseId\r\n            \'\r\n            ,\'sys_menu\'\r\n            )\r\n		)\r\n	) or \r\n	(\r\n		u.user_type = \'common\'\r\n		and emu.id is null \r\n		and m.id in(\r\n            $service.findAllParent(\'\r\n			    select menu_id from position_menu \r\n                where enterprise_id = $enterpriseId  \r\n                and position_id in(\r\n                    select position_id from enterprise_user_position \r\n                    where enterprise_user_id in (\r\n                        select id from enterprise_user where enterprise_id = $enterpriseId  and user_id = $userId \r\n                    )\r\n                )\r\n            \'\r\n            ,\'sys_menu\'\r\n            )\r\n		)\r\n	)\r\n)\r\n', 'list', '', '', '当前用户按钮', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(25, 'deptManager', '-- 查询用户\nselect\n	dm.id, -- 主键\n	dm.dept_id, -- 部门id\n	u.user_code, -- 用户编号\n	u.name, -- 姓名\n	dept.name dept_name, -- 部门名称\n	u.mobile, -- 手机号\n	u.create_time, -- 创建时间\n	u.update_time, -- 更新时间\n	u.avatar, -- 头像\n	u.user_type, -- 用户类型\n	u.user_status, -- 用户状态\n	u.other_files -- 附件列表\nfrom dept_manager dm \nleft join enterprise_user eu on eu.id = dm.enterprise_user_id\nleft join user u on eu.user_id = u.id\nleft join dept on dept.id = eu.dept_id', 'list', ' order by id desc ', '', '部门负责人', '', '', NULL, NULL, 'NO', NULL, NULL, NULL, NULL, NULL),(26, 'permission', '-- 查询权限\nselect\n	id, -- 主键\n	p.code, -- 权限编码\n	p.name, -- 权限名称\n	p.permission_type, -- 权限类型\n	p.permission_value, -- 配置值\n	p.component_type, -- 组件类型\n	p.muiti, -- 是否多选\n	p.remark -- 备注\nfrom permission p', 'list', ' order by id desc ', '', '权限列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(27, 'positionPermission', '-- 查询权限\nselect\n	id, -- 主键\n	p.code, -- 权限编码\n	p.name, -- 权限名称\n	p.permission_type, -- 权限类型\n	p.permission_value, -- 配置值\n	p.component_type, -- 组件类型\n	p.muiti, -- 是否多选\n	p.remark -- 备注\nfrom permission p', 'list', ' order by id desc ', '', '岗位数据权限', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(28, 'deptPermission', '-- 查询权限\nselect\n	id, -- 主键\n	p.code, -- 权限编码\n	p.name, -- 权限名称\n	p.permission_type, -- 权限类型\n	p.permission_value, -- 配置值\n	p.component_type, -- 组件类型\n	p.muiti, -- 是否多选\n	p.remark -- 备注\nfrom permission p', 'list', ' order by id desc ', '', '部门数据权限', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(29, 'customerSource', '-- 查询客户来源\nselect\n	id, -- 主键\n	cs.code, -- 来源编码\n	cs.name, -- 来源名称\n	cs.parent_id -- 父id\nfrom customer_source cs', 'tree', 'order by code asc', '', '客户来源列表', 'name', 'id', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),(30, 'customer', '-- 查询客户\nselect\n	c.id, -- 主键\n	c.enterprise_id, -- 企业id\n	u.name user_name, -- 创建人\n	d.name dept_name, -- 所属部门\n	c.customer_source_id, -- 客户来源id\n	c.name, -- 客户姓名\n	c.mobile, -- 手机号\n	c.decoration_type, -- 装修类型\n	c.address, -- 客户地址\n	c.area, -- 面积\n	c.customer_status -- 客户状态\nfrom customer c\nleft join user u on u.id = c.user_id\nleft join dept d on d.id = c.dept_id\nwhere c.enterprise_id = $enterpriseId\n$service.permission(\'selfOrAll\',\'c.user_id\')\n$service.permission(\'dept\',\'c.dept_id\')\n$service.permission(\'decorationType\',\'c.decoration_type\')', 'list', ' order by id desc ', '', '客户列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(33, 'customerRecord', '-- 查询客户审核记录\nselect\n	cr.id, -- 主键\n	cr.customer_id, -- 客户id\n	cr.customer_status, -- 客户状态\n	cr.create_time, -- 审核时间\n	u.name audit_user, -- 审核人\n	cr.audit_result, -- 审核结果\n	cr.audit_remark, -- 备注\n	cr.audit_imgs, -- 图片\n	cr.audit_files -- 附件\nfrom customer_record cr\nleft join user u on u.id = cr.audit_user_id', 'list', 'order by create_time desc', '', '客户审核记录', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(34, 'timerTask', '-- 查询定时任务\nselect\n	id, -- 主键\n	tt.name, -- 任务名称\n	tt.api, -- 接口\n	tt.scheduling_pattern, -- 执行频率\n	tt.data_status, -- 状态\n	tt.params -- 参数\nfrom timer_task tt', 'list', ' order by id desc ', '', '定时任务列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(35, 'timerTaskRecord', 'select * from timer_task_record', 'list', 'order by id desc', '', '定时任务记录', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(36, 'dynamicTask', '-- 查询动态任务\nselect\n	id, -- 主键\n	dt.name, -- 任务名称\n	dt.ref_id, -- 关联id\n	dt.params, -- 参数\n	dt.timer_task_status, -- 任务状态\n	dt.msg, -- 提示信息\n	dt.plan_time, -- 计划执行时间\n	dt.start_time, -- 开始时间\n	dt.end_time, -- 结束时间\n	dt.api, -- 接口\n	dt.create_time -- 创建时间\nfrom dynamic_task dt', 'list', 'order by create_time desc', '', '动态任务列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(38, 'menuUrl', '-- 查询菜单url\nselect\n	id, -- 主键\n	mu.menu_id, -- 菜单id\n	mu.name, -- 名称\n	mu.url -- url\nfrom menu_url mu', 'list', ' order by id desc ', '', '菜单url列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(39, 'menuUrlAll', '-- 查询菜单url\nselect\n	mu.id, -- 主键\n	mu.menu_id, -- 菜单id\n	m.menu_name, -- 菜单名称\n	mu.name, -- 名称\n	mu.url -- url\nfrom menu_url mu\nleft join sys_menu m on m.id = mu.menu_id', 'list', ' order by id desc ', '', '全部url', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(40, 'currentUserUrl', 'select distinct url from  menu_url\r\n\r\nwhere \r\nmenu_id is null  \r\nor menu_id in (\r\n	select distinct m.id from sys_menu m\r\n	left join user u on u.id = $userId\r\n	left join enterprise_manager emu on emu.user_id = $userId and emu.enterprise_id = $enterpriseId \r\n	where \r\n	-- 后台菜单\r\n	m.menu_type = 1 \r\n	and\r\n	(\r\n		(\r\n			(\r\n				u.user_type = \'admin\'\r\n				or emu.id is not null\r\n			)\r\n			and m.id in (\r\n				$service.findAllParent(\'\r\n					select menu_id from enterprise_menu em where em.enterprise_id = $enterpriseId\r\n				\'\r\n				,\'sys_menu\'\r\n				)\r\n			)\r\n		) or \r\n		(\r\n			u.user_type = \'common\'\r\n			and emu.id is null \r\n			and m.id in(\r\n				$service.findAllParent(\'\r\n					select menu_id from position_menu \r\n					where enterprise_id = $enterpriseId  \r\n					and position_id in(\r\n						select position_id from enterprise_user_position \r\n						where enterprise_user_id in (\r\n							select id from enterprise_user where enterprise_id = $enterpriseId  and user_id = $userId \r\n						)\r\n					)\r\n				\'\r\n				,\'sys_menu\'\r\n				)\r\n			)\r\n		)\r\n	)\r\n)\r\n', 'list', '', '', '当前用户url', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(41, 'logTable', '-- 查询记录日志的表\nselect\n	id, -- 主键\n	lt.table_name, -- 表名\n	lt.table_comment, -- 注释\n	lt.open_cache, -- 是否开启缓存\n	lt.save_log, -- 保存日志\n	lt.cache_key_fields -- 缓存字段列表\nfrom log_table lt', 'list', ' order by id desc ', '', '记录日志的表列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(42, 'userPermission', '-- 查询权限\nselect\n	id, -- 主键\n	p.code, -- 权限编码\n	p.name, -- 权限名称\n	p.permission_type, -- 权限类型\n	p.permission_value, -- 配置值\n	p.component_type, -- 组件类型\n	p.muiti, -- 是否多选\n	p.remark -- 备注\nfrom permission p', 'list', ' order by id desc ', '', '用户数据权限', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(43, 'optionLog', 'select l.ref_id id,l.create_time,t.TABLE_COMMENT,l.table_name,l.remark,\r\ncase \r\n	when l.option_type = \'新建\'\r\n		then l.after_value\r\n	when l.option_type = \'删除\'\r\n		then l.before_value\r\n	else \'\' \r\nend detail\r\n from global_log l \r\nleft join information_schema.`TABLES` t on UPPER(t.TABLE_NAME) = UPPER(l.table_name) and t.TABLE_SCHEMA = \'jqp\'\r\n\r\n', 'list', 'order by create_time desc', '', '操作日志', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(44, 'activity', 'SELECT\r\n	m.ID_ id,\r\n	m.DEPLOYMENT_ID_ `deployment_id`,\r\n	d.VERSION_ version,\r\n	d.ID_ process_definition_id,\r\n	m.NAME_ `name`,\r\n	m.KEY_ `key`,\r\n	m.CREATE_TIME_ create_time,\r\n	m.LAST_UPDATE_TIME_ update_time \r\nFROM\r\n	act_re_model m\r\nleft join act_re_procdef d on d.DEPLOYMENT_ID_ = m.DEPLOYMENT_ID_', 'list', NULL, '', '流程设计', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(45, 'deployment', 'SELECT\r\n	d.id_ id,\r\n	m.ID_ deployment_id,\r\n	d.name_ name,\r\n	d.key_ `key`,\r\n	d.VERSION_ version,\r\n	d.DESCRIPTION_ description ,\r\n	m.DEPLOY_TIME_ deploy_time\r\nFROM\r\n	act_re_procdef d\r\nleft join	act_re_deployment m on m.ID_ = d.DEPLOYMENT_ID_', 'list', 'order by deploy_time desc', '', '部署管理', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(46, 'processInstance', 'SELECT\r\n	i.ID_ id,\r\n	i.NAME_ name,\r\n	i.START_TIME_ start_time,\r\n	i.END_TIME_ end_time,\r\n	i.BUSINESS_KEY_ business_key,\r\n	def.NAME_ def_name,\r\n	def.KEY_ `key`,\r\n	def.ID_ def_id,\r\n	def.VERSION_ `version`\r\nFROM\r\n	`act_hi_procinst` i\r\nleft join act_re_procdef def on i.PROC_DEF_ID_ = def.ID_', 'list', 'order by start_time desc', '', '流程实例', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(47, 'activityTask', 'SELECT\r\n	t.ID_ id,\r\n	t.NAME_ name,\r\n	t.START_TIME_ task_start_time,\r\n	t.END_TIME_ task_end_time,\r\n	i.ID_ instance_id,\r\n	i.NAME_ instance_name,\r\n	i.START_TIME_ start_time,\r\n	i.END_TIME_ end_time,\r\n	i.BUSINESS_KEY_ business_key,\r\n	tu.users,\r\n	u.`name` exec_user,\r\n	def.NAME_ def_name,\r\n	def.KEY_ `key`,\r\n	def.ID_ def_id,\r\n	def.VERSION_ `version`\r\nFROM\r\n act_hi_taskinst t \r\nleft join	`act_hi_procinst` i on t.PROC_INST_ID_ = i.ID_\r\nleft join act_re_procdef def on i.PROC_DEF_ID_ = def.ID_\r\nleft join user u on u.id = t.OWNER_\r\nleft join (\r\n	select m.task_id,GROUP_CONCAT(m.name order by m.user_id asc) users from (\r\n\r\n		select distinct s.*,u.`name` from (\r\n\r\n			-- 直接分派人\r\n			select \r\n				t.ID_ task_id,\r\n				t.ASSIGNEE_ user_id \r\n			from act_hi_taskinst t \r\n			where t.ASSIGNEE_ is not null\r\n\r\n			union all\r\n\r\n			-- 候选人\r\n			SELECT \r\n				ahi.TASK_ID_,ahi.USER_ID_ \r\n			FROM `act_hi_identitylink` ahi \r\n			where ahi.TASK_ID_ \r\n			and ahi.USER_ID_ is not null\r\n\r\n			union all\r\n\r\n			-- 候选岗位查出的候选人\r\n			SELECT \r\n				ahi.TASK_ID_,eu.user_id\r\n			FROM `act_hi_identitylink` ahi \r\n			left join position p on p.`code` = ahi.GROUP_ID_\r\n			left join enterprise_user_position eup on eup.position_id = p.id \r\n			left join enterprise_user eu on eu.id = eup.enterprise_user_id and eu.enterprise_id = $enterpriseId\r\n			where ahi.TASK_ID_ \r\n			and ahi.GROUP_ID_ is not null\r\n\r\n		) s \r\n		left join user u on u.id = s.user_id\r\n		where u.id is not null\r\n	) m \r\n	group by m.task_id \r\n) tu on tu.task_id = t.ID_\r\n', 'list', 'order by task_start_time desc', '', '流程任务', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(48, 'testOrder', '-- 查询测试订单\nselect\n	to_.id, -- 主键\n	to_.order_code, -- 订单号\n	to_.customer_manager_id, -- 客户经理id\n	cm.name customer_manager_name, -- 客户经理\n	to_.designer_id, -- 设计师id\n	d.name designer_name , -- 设计师\n	to_.test_order_status, -- 订单状态\n	to_.create_time, -- 创建时间\n	to_.amount -- 订单金额\nfrom test_order to_\nleft join user cm on cm.id = to_.customer_manager_id\nleft join user d on d.id = to_.designer_id', 'list', ' order by id desc ', '', '测试订单列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(49, 'enterpriseUserSelector', '-- 查询用户\nselect\n	u.id, -- 主键\n	u.user_code, -- 用户编号\n	u.name, -- 姓名\n	dept.name dept_name, -- 部门名称\n	u.mobile -- 手机号\nfrom enterprise_user eu\nleft join user u on eu.user_id = u.id\nleft join dept on dept.id = eu.dept_id\nwhere eu.enterprise_id = $enterpriseId', 'list', 'order by id desc', '', '企业用户选择器', 'name', 'id', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(50, 'article', '-- 查询文章\nselect\n	a.id, -- 主键\n	a.title, -- 标题\n	a.content, -- 内容\n	a.update_time -- 更新日期\nfrom article a', 'list', ' order by id desc ', '', '文章列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(52, 'chart', '-- 查询图表\nselect\n	c.id, -- 主键\n	c.name, -- 名称\n	c.code, -- 编号\n	c.config, -- 配置\n	c.querySql -- 查询sql\nfrom chart c', 'list', ' order by id desc ', '', '图表列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(53, 'chartTestData1', '-- 查询图表测试数据1\nselect\n	ctd.id, -- 主键\n	ctd.name, -- 姓名\n	ctd.year, -- 年份\n	ctd.salary -- 工资\nfrom chart_test_data1 ctd', 'list', ' order by id desc ', '', '图表测试数据1列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(54, 'myActivityTask', 'SELECT\r\n	t.ID_ id,\r\n	t.NAME_ name,\r\n	t.START_TIME_ task_start_time,\r\n	t.END_TIME_ task_end_time,\r\n	i.ID_ instance_id,\r\n	i.NAME_ instance_name,\r\n	i.START_TIME_ start_time,\r\n	i.END_TIME_ end_time,\r\n	i.BUSINESS_KEY_ business_key,\r\n	def.NAME_ def_name,\r\n	def.KEY_ `key`,\r\n	def.ID_ def_id,\r\n	def.VERSION_ `version`\r\nFROM\r\n act_hi_taskinst t \r\nleft join	`act_hi_procinst` i on t.PROC_INST_ID_ = i.ID_\r\nleft join act_re_procdef def on i.PROC_DEF_ID_ = def.ID_\r\nleft join (\r\n	select m.task_id,GROUP_CONCAT(m.name order by m.user_id asc) users from (\r\n\r\n		select distinct s.*,u.`name` from (\r\n\r\n			-- 直接分派人\r\n			select \r\n				t.ID_ task_id,\r\n				t.ASSIGNEE_ user_id \r\n			from act_hi_taskinst t \r\n			where t.ASSIGNEE_ is not null\r\n\r\n			union all\r\n\r\n			-- 候选人\r\n			SELECT \r\n				ahi.TASK_ID_,ahi.USER_ID_ \r\n			FROM `act_hi_identitylink` ahi \r\n			where ahi.TASK_ID_ \r\n			and ahi.USER_ID_ is not null\r\n\r\n			union all\r\n\r\n			-- 候选岗位查出的候选人\r\n			SELECT \r\n				ahi.TASK_ID_,eu.user_id\r\n			FROM `act_hi_identitylink` ahi \r\n			left join position p on p.`code` = ahi.GROUP_ID_\r\n			left join enterprise_user_position eup on eup.position_id = p.id \r\n			left join enterprise_user eu on eu.id = eup.enterprise_user_id and eu.enterprise_id = $enterpriseId\r\n			where ahi.TASK_ID_ \r\n			and ahi.GROUP_ID_ is not null\r\n\r\n		) s \r\n		left join user u on u.id = s.user_id\r\n		where u.id is not null\r\n		and u.id = $userId\r\n	) m \r\n	group by m.task_id \r\n) tu on tu.task_id = t.ID_\r\nwhere tu.users is not null\r\n', 'list', 'order by task_start_time desc', '', '我的任务', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(55, 'dataListener', '-- 查询数据监听\nselect\n	dl.id, -- 主键\n	dl.table_name, -- 表名称\n	dl.event_type, -- 事件类型\n	dl.column_name, -- 字段名称\n	dl.after_api, -- magic接口\n	dl.java_bean, -- java接口\n	dl.seq -- 序号\nfrom data_listener dl', 'list', 'order by id desc', '', '数据监听列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(56, 'customPage', '-- 查询自定义页面\nselect\n	cp.id, -- 主键\n	cp.code, -- 编号\n	cp.name, -- 名称\n	concat(\'/admin/custom/page/\',cp.code) path, -- 路径\n	cp.content -- 内容\nfrom custom_page cp', 'list', ' order by id desc ', '', '自定义页面列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(57, 'dataImportTemplate', '-- 查询数据导入配置\nselect\n	dit.id, -- 主键\n	dit.table_name, -- 表\n	dit.code, -- 模板编号\n	dit.name, -- 模板名称\n	dit.repeat_fields, -- 判重字段列表\n	dit.repeat_strategy -- 判重处理策略\nfrom data_import_template dit', 'list', ' order by id desc ', '', '数据导入配置列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(58, 'dataImportTask', '-- 查询数据导入任务\nselect\n	dit.id, -- 主键\n	dit.user_id, -- 用户id\n	dit.enterprise_id, -- 企业id\n	dit.create_time, -- 创建时间\n	dit.plan_time, -- 计划时间\n	dit.start_time, -- 开始时间\n	dit.end_time, -- 结束时间\n	dit.data_import_task_status, -- 任务状态\n	dit.src_file, -- 源文件\n	dit.error_file, -- 错误文件\n	dit.error_msg, -- 错误提示\n	dit.template_code -- 模板编号\nfrom data_import_task dit', 'list', ' order by id desc ', '', '数据导入任务列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(59, 'testDataImport', '-- 查询测试数据导入\nselect\n	tdi.id, -- 主键\n	tdi.user_id, -- 用户id\n	tdi.enterprise_id, -- 企业id\n	tdi.birthday, -- 生日\n	tdi.age, -- 年龄\n	tdi.gender -- 性别\nfrom test_data_import tdi', 'list', ' order by id desc ', '', '测试数据导入列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(60, 'sqlInfo', '-- 查询sql语句\nselect\n	si.id, -- 主键\n	si.code, -- 编号\n	si.name, -- 名称\n	si.sql_info, -- sql语句\n	si.sql_type, -- sql类型\n	si.ref_sql_codes -- 关联sql\nfrom sql_info si', 'list', ' order by id desc ', '', 'sql语句列表', 'name', 'code', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(61, 'sqlApi', '-- 查询sql接口\nselect\n	sa.id, -- 主键\n	sa.name, -- 名称\n	sa.code, -- 编号\n	sa.sql_api_prefix, -- 前缀\n	sa.sql_api_type -- 类型\nfrom sql_api sa', 'list', ' order by id desc ', '', 'sql接口列表', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(63, 'icon', '-- 查询图标\nselect\n	i.id, -- 主键\n	concat(\'fa fa-\',i.icon)  icon, -- 图标\n	i.name, -- 名称\n	\' \' label,\n	i.whether_common -- 常见图标\nfrom icon i', 'list', '', '', '图标列表', NULL, NULL, NULL, NULL, 'YES', '<p>amis图标使用的是fontawesome,<a target=\'_blank\'  href=\'https://fontawesome.com/\'>官网</a>,<a target=\'_blank\' href=\'https://fontawesome.com/search?o=r&c=editing&s=duotone\'>搜索图标</a></p>', NULL, 50, NULL, NULL),(64, 'template', '-- 查询模板\nselect\n	t.id, -- 主键\n	t.code, -- 编号\n	t.name, -- 名称\n	t.seq, -- 序号\n	t.template_type, -- 序号\n	t.parent_id -- 父id\nfrom template t', 'tree', ' order by seq asc', '', '模板列表', 'name', 'id', 4, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(66, 'flow', '-- 查询流程\nselect\n	f.id, -- 主键\n	f.code, -- 编号\n	f.name, -- 名称\n	f.last_version, -- 最新版本\n	f.table_name, -- 表名称\n	f.status_field, -- 状态字段\n	f.status_dic, -- 状态字典\n	f.view_form, -- 查看表单\n	f.before_api, -- 前置接口\n	f.after_api -- 后置接口\nfrom flow f', 'list', ' order by id desc ', '', '流程列表', NULL, NULL, NULL, NULL, 'YES', NULL, 'YES', NULL, NULL, NULL),(67, 'flowDeploy', '-- 查询流程部署\nselect\n	fd.id, -- 主键\n	fd.code, -- 编号\n	fd.name, -- 名称\n	fd.version, -- 当前版本\n	fd.table_name, -- 表名称\n	fd.status_field, -- 状态字段\n	fd.status_dic, -- 状态字典\n	fd.view_form, -- 查看表单\n	fd.before_api, -- 前置接口\n	fd.after_api -- 后置接口\nfrom flow_deploy fd', 'list', ' order by id desc ', '', '流程部署列表', NULL, NULL, NULL, NULL, 'YES', NULL, 'YES', NULL, NULL, NULL),(68, 'flowInstance', '-- 查询流程实例\nselect\n	fi.id, -- 主键\n	fi.flow_deploy_id, -- 流程部署id\n	fi.flow_id, -- 流程id\n	fi.ref_id, -- 关联id\n	fi.name, -- 流程实例名称\n	fi.start_time, -- 开始时间\n	fi.end_time, -- 结束时间\n	fi.current_task_id, -- 当前任务id\n	fi.current_task_name, -- 当前任务名称\n	fi.flow_code, -- 流程编码\n	fi.flow_name, -- 流程名称\n	fd.version, -- 流程版本\n	fi.create_user_id, -- 发起人id\n	fi.create_user_name, -- 发起人姓名\n	fi.enterprise_id, -- 企业id\n	fi.view_form -- 查看表单\nfrom flow_instance fi\nleft join flow_deploy fd on fd.id = fi.flow_deploy_id', 'list', 'order by start_time desc', '', '流程实例', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),(69, 'flowInstanceTask', '-- 查询流程实例任务\nselect\n	fit.id, -- 主键\n	fit.flow_instance_id, -- 流程实例id\n	fit.task_name, -- 任务名称\n	fit.task_id, -- 任务id\n	fit.start_time, -- 开始时间\n	fit.end_time, -- 结束时间\n	fit.edge_id, -- 流转id\n	fit.edge_name, -- 流转名称\n	fit.candidate_user_ids, -- 候选人列表\n	fit.candidate_position_codes, -- 候选岗位列表\n	fit.audit_user_id, -- 审核人id\n	fit.audit_user_name, -- 审核人姓名\n	fit.order_status, -- 单据状态\n	fit.order_status_name, -- 单据状态名称\n	fit.order_status_dic, -- 状态字典\n	fit.table_name, -- 表名\n	fit.ref_id, -- 关联id\n	fit.flow_code, -- 流程编码\n	fit.flow_name, -- 流程名称\n	fit.flow_instance_name, -- 流程实例名称\n	fit.audit_remark, -- 审核备注\n	fit.audit_files, -- 审核附件\n	fit.audit_imgs, -- 审核图片\n	fit.enterprise_id, -- 企业id\n	fit.view_form, -- 查看表单\n	fit.pass, -- 是否通过\n	fit.create_user_id, -- 创建人id\n	fit.create_user_name -- 创建人姓名\nfrom flow_instance_task fit', 'list', 'order by start_time desc ,id desc', '', '流程任务', NULL, NULL, NULL, NULL, 'YES', NULL, NULL, NULL, NULL, NULL);
